import { useState } from "react";


function John({red,gre,on,off}){

    const{color,setColor}=useState(red)
    const{data,setData}=useState(on)

    const Upon=()=>{
        let a=data==on ? off :on
        setData(a)
        let b=color==red ? gre:red
        setColor(b)
    }
    return(
        <div style={{backgroundColor:"red",width:"300px",height:"300px",borderRadius:"50%"}}>
            
            <button onClick={Upon}>ON</button>
        </div>
    )
}


export default John;
